import React from 'react';
import classes from './Header.css';

const header = ()=>{
    return (
        <div className={classes.Header}>
            <ul className={classes.Items}>
                <li className={classes.item}>Home</li>
                <li>Tour</li>
                <li>Package</li>
                <li>Flight</li>
                <li>Train</li>
                <li>Contact</li>
                <li>About</li>
            </ul>
        </div>
    );
};

export default header;
